import React, {Component} from 'react';
import {  Form } from 'react-bootstrap';

class Review extends Component {
    render () {
        return (
            <div className="Reviews">
                <form>
                    <Form.Group>
                        <Form.Label>Email</Form.Label>
                        <Form.Control></Form.Control>
                    </Form.Group>
                </form>
            </div>
        );
    }
}

export default Review;
